import React from 'react';

const Todo= ({text})=>{
    return (
        <div className="todo">
            <li className="todo-item">{text}</li>
            <button onClick={delte} className="trash-btn"><i className="fas fa-trash"></i></button>
            <button className="complete-btn"><i className="fas fa-check"></i></button>
        </div>
    )
}
export default Todo;
